module.exports = "<nav class=\"navbar navbar-default navbar-fixed-top\">\n      <div class=\"container\">\n        <div class=\"navbar-header\">\n          <button type=\"button\" class=\"navbar-toggle collapsed\" data-toggle=\"collapse\" data-target=\"#navbar\" aria-expanded=\"false\" aria-controls=\"navbar\">\n            <span class=\"sr-only\">Toggle navigation</span>\n            <span class=\"icon-bar\"></span>\n            <span class=\"icon-bar\"></span>\n            <span class=\"icon-bar\"></span>\n          </button>\n          <a class=\"navbar-brand\" href=\"#\">Welloculus Wiki</a>\n        </div>\n        <div id=\"navbar\" class=\"navbar-collapse collapse\">\n          <ul class=\"nav navbar-nav navbar-right right-menu\">\n            <li><a href=\"https://welloculus.github.io/Cockpit/public/\" target=\"_blank\">Cockpit</a></li>\n            <li class=\"bordersection\"></li>\n            <li><a href=\"https://welloculus.github.io/website/\" target=\"_blank\">Website</a></li>\n<!--            <li class=\"dropdown\">\n              <a href=\"#\" class=\"dropdown-toggle\" data-toggle=\"dropdown\" role=\"button\" aria-haspopup=\"true\" aria-expanded=\"false\">Technology Stack <span class=\"caret\"></span></a>\n              <ul class=\"dropdown-menu\">\n                <li><a href=\"#\">Wiki 1</a></li>\n                <li><a href=\"#\">Wiki 2</a></li>\n                <li><a href=\"#\">Wiki 3</a></li>\n              </ul>\n         </li> -->\n          </ul>\n        </div>\n        <!--/.nav-collapse -->\n      </div>\n    </nav>\n"

